  public subirArchivo(archivo, fileName) {
    let referencia = this.firestoreService.referenciaCloudStorage(fileName);
    let tarea = this.firestoreService.tareaCloudStorage(fileName, archivo);

    tarea.percentageChanges().subscribe((porcentaje) => {
      if (porcentaje === 100) {
        referencia.getDownloadURL().subscribe((URL) => {
          this.URLPublica = URL;

          const dataEmail = {
            nombres: this.dataCliente.nombres,
            fecha: this.dataCita.fecha,
            hora: this.dataCita.hora,
            codigoCita: this.codCita,
            email: this.dataCliente.email,
            numPdf: this.selectedNumPdf.numPdf,
            agencia: this.infAgencie,
            oficial: this.infOfficer,
            pdf: this.URLPublica
          };


          if (dataEmail.email === '') {
            this.firestoreService.sendEmailToOfficer(dataEmail).subscribe((dataEmailApi) => {
              console.log(dataEmailApi);
              if(dataEmailApi) {
                Swal.fire(
                  'Cita creada correctamente',
                  'En breve recibirá la confirmación de la cita en su número de teléfono',
                  'success'
                );
                this.startDownload();
                this.finalizado = true;
                this.band.unsubscribe();
              } else {
                Swal.fire(
                  'Error al notificar',
                  'No se ha notificado la cita al oficial de cooperativa',
                  'error'
                );
                this.finalizado = true;
                this.band.unsubscribe();
              }
            });

          } else {
            this.firestoreService.sendEmail(dataEmail).subscribe((dataEmailApi) => {
              if(dataEmailApi) {
                Swal.fire(
                  'Cita creada correctamente',
                  'En breve recibirá la confirmación de la cita en su número de teléfono',
                  'success'
                );
              } else {
                Swal.fire(
                  'Ooops...',
                  'Algo ha ido mal, vuelva a intentarlo más tarde',
                  'error'
                );
              }
            });
          }
        });
      }
    });

  }
  startDownload() {
    const url = this.URLPublica;
    window.open(url, 'Download');
  }
  ngOnDestroy(){
    if(this.band !== undefined) {
      this.band.unsubscribe();
    }
  }
